    Given an array, find the sum of repeated elements in the array.
    For example:
    find_Sum([1,2,3,4,5,6,7,8,9,1,2,3],12) == 12
    find_Sum([1,2,3,4,5,6,7,8,9,1,2,3,4,5,6,7,8,9],18) == 90
    find_Sum([1,2,3,4,5,6,7,8,9],9) == 0
    """
    counts = {}
    repeated_sum = 0
    for num in arr:
        if num in counts:
            counts[num] += 1
        else:
            counts[num] = 1
    for num, count in counts.items():
        if count > 1:
            repeated_sum += num * count
    return repeated_sum
