def is_samepatterns(colors, patterns):
    """
    Check whether it follows the sequence given in the patterns array.
    For example:
    is_samepatterns(["red", "green", "blue", "red", "green"], ["red", "green"]) == True
    is_samepatterns(["red", "green", "blue", "red", "yellow"], ["red", "green"]) == False
    """
    if not patterns:
        return True

    pattern_len = len(patterns[0])
    for color in colors:
        if len(color) != pattern_len:
            return False
        for i in range(pattern_len):
            if color[i] != patterns[0][i]:
                return False
    return True
