    Given a list of integers, find the minimum length of sublist that contains at least two equal numbers.
    For example:
    Find_Min_Length([1,2,3,4,2,3,1]) == 4
    Find_Min_Length([1,2,3,4,5]) == -1
    """
    min_length = float('inf')
    for i in range(len(lst)):
        for j in range(i + 1, len(lst)):
            if lst[i] == lst[j]:
                min_length = min(min_length, j - i + 1)
    if min_length == float('inf'):
        return -1
    else:
