def merge_sorted_list(num1, num2, num3):
    """
    Merges multiple sorted lists into a single sorted iterator using the heap queue algorithm.

    Args:
        num1: The first sorted list.
        num2: The second sorted list.
        num3: The third sorted list.

    Returns:
        A generator that yields the elements of the merged sorted list.
    """
    heap = []

    # Initialize the heap with the first element of each list
    if num1:
        heapq.heappush(heap, (num1[0], 0))  # (value, list_index)
    if num2:
        heapq.heappush(heap, (num2[0], 1))
    if num3:
        heapq.heappush(heap, (num3[0], 2))

    while heap:
        val, list_index = heapq.heappop(heap)
        yield val

        if list_index == 0:
            if num1:
                heapq.heappush(heap, (num1[0], 0))
        elif list_index == 1:
            if num2:
                heapq.heappush(heap, (num2[0], 1))
        elif list_index == 2:
            if num3:
                heapq.heappush(heap, (num3[0], 2))
