def extract_missing(test_list, strt_val, stop_val):
    """
    Extracts the ranges that are missing from the given list with the given start range and end range values.
    For example:
    extract_missing([1, 2, 3, 5, 6, 8, 9], 1, 9) == [4, 7]
    extract_missing([1, 2, 3, 5, 6, 8, 9], 2, 8) == [4]
    extract_missing([1, 2, 3, 5, 6, 8, 9], 1, 10) == [4, 7, 10]
    """
    missing_ranges = []
    test_list.sort()
    if not test_list:
        if strt_val > stop_val:
            missing_ranges.append(list(range(strt_val, stop_val + 1)))
        else:
            missing_ranges.append(list(range(strt_val, stop_val + 1)))
        return missing_ranges

    if test_list[0] > strt_val:
        missing_ranges.extend(list(range(strt_val, test_list[0] + 1)))

    for i in range(len(test_list) - 1):
        if test_list[i+1] - test_list[i] > 1:
            missing_ranges.extend(list(range(test_list[i] + 1, test_list[i+1])))

    if test_list[-1] < stop_val:
        missing_ranges.extend(list(range(test_list[-1] + 1, stop_val + 1)))

    return missing_ranges
