def search(arr,n):
    """
    Given a sorted array, find the element that appears only once in the array.
    For example:
    search([1,2,2,3,4,4,6,6,8],9) == 1
    search([1,2,2,3,4,4,6,6,8],9) == 1
    search([1,1,2,2,3,3,4,4,5],9) == 5
    """
    low = 0
    high = n - 1

    while low <= high:
        mid = (low + high) // 2

        if mid > 0 and mid < n - 1 and arr[mid] == arr[mid - 1] and arr[mid] == arr[mid + 1]:
            high = mid - 1
        elif mid > 0 and mid < n - 1 and arr[mid] == arr[mid - 1]:
            high = mid - 1
        elif mid > 0 and mid < n - 1 and arr[mid] == arr[mid + 1]:
            low = mid + 1
        elif mid == 0 and n > 1 and arr[mid] == arr[mid + 1]:
            low = mid + 1
        elif mid == n - 1 and n > 1 and arr[mid] == arr[mid - 1]:
            high = mid - 1
        else:
            return arr[mid]
