def sum(a,b):
    """
    Find the sum of common divisors of two given numbers.
    For example:
    sum(12,18) == 24
    sum(5,10) == 15
    """
    divisors_a = []
    divisors_b = []
    for i in range(1, min(a, b) + 1):
        if a % i == 0:
            divisors_a.append(i)
        if b % i == 0:
            divisors_b.append(i)
    common_divisors = []
    for divisor in divisors_a:
        if divisor in divisors_b:
            common_divisors.append(divisor)
    return sum(common_divisors)
