def string_literals(patterns,text):
    """
    Given a string text, search for all occurrences of the given patterns in the text.
    Return a dictionary where the keys are the patterns and the values are lists of the starting indices of the occurrences of the patterns in the text.
    If a pattern does not occur in the text, it should not be present in the dictionary.
    For example:
    string_literals(["hello","world"], "hello world hello") == {"hello":[0,12], "world":[6]}
    string_literals(["hello","world"], "hello world") == {"hello":[0], "world":[6]}
    string_literals(["hello","world"], "hello") == {"hello":[0]}
    """
    result = {}
    for pattern in patterns:
        occurrences = []
        start = 0
        while True:
            start = text.find(pattern, start)
            if start == -1:
                break
            occurrences.append(start)
            start += 1
        if occurrences:
            result[pattern] = occurrences
    return result
```

