def get_total_number_of_sequences(m,n):
    """
    Find the number of possible sequences of length n such that each of the next element is greater than or equal to twice of the previous element but less than or equal to m.
    For example:
    get_total_number_of_sequences(5, 2) == 6
    get_total_number_of_sequences(10, 3) == 27
    """
    if n == 0:
        return 1
    if m <= 2:
        return 0
    dp = {}
    def solve(prev, length):
        if length == n:
            return 1
        if (prev, length) in dp:
            return dp[(prev, length)]
        count = 0
        for i in range(prev + 1, m):
            count += solve(i, length + 1)
        dp[(prev, length)] = count
        return count
    return solve(0, 0)
```

