def get_total_number_of_sequences(m,n):
    """
    Find the number of possible sequences of length n such that each of the next element is greater than or equal to twice of the previous element but less than or equal to m.
    For example:
    get_total_number_of_sequences(5, 2) == 19
    get_total_number_of_sequences(10, 3) == 262
    """
    if n == 1:
        return 1
    dp = [[0] * (m + 1) for _ in range(n + 1)]
    for i in range(1, m + 1):
        dp[1][i] = 1
    for i in range(2, n + 1):
        for j in range(1, m + 1):
            for k in range(max(2 * j, 1), m + 1):
                dp[i][j] += dp[i - 1][k]
    total = 0
    for i in range(1, m + 1):
        total += dp[n][i]
    return total
