def sort_on_occurence(lst):
    """
    Sorts the given list based on the occurrence of the first element of tuples.

    Args:
        lst (list): A list of tuples.

    Returns:
        list: A new list with tuples sorted based on the occurrence of the first element.
    """
    counts = {}
    for tup in lst:
        if tup[0] in counts:
            counts[tup[0]] += 1
        else:
            counts[tup[0]] = 1

    return sorted(lst, key=lambda tup: counts[tup[0]])
