    For example:
    max_sum([9, 6, 4, 6, 8, 2, 1], 7) == 28
    max_sum([1, 15, 7, 2, 9, 10, 4], 7) == 33
    max_sum([10, 22, 9, 33, 21, 50, 41, 60, 80], 9) == 255
    """
    inc = [0] * n
    dec = [0] * n
    for i in range(n):
        inc[i] = arr[i]
        for j in range(i):
            if arr[i] > arr[j]:
                inc[i] = max(inc[i], inc[j] + arr[i])
    for i in range(n - 1, -1, -1):
        dec[i] = arr[i]
        for j in range(n - 1, i, -1):
