    Substract the contents of one tuple with corresponding index of other tuple.
    For example:
    substract_elements((10, 20, 30), (5, 10, 15)) == (5, 10, 15)
    substract_elements((10, 20, 30), (5, 10)) == (5, 10, 30)
    """
