def find_Divisor(x, y):
    """
    Given an interval [x, y], find the maximum occurring divisor in the interval.
    For example:
    find_Divisor(1, 10) == 1
    find_Divisor(1, 12) == 1
    find_Divisor(2, 20) == 2
    """
    if x == 0:
        return 0

    max_divisor = 1
    count = 0
    for i in range(1, int(y**0.5) + 1):
        if y % i == 0:
            if i <= y:
                if i >= x:
                    count_i = 0
                    for j in range(x, y + 1):
                        if j % i == 0:
                            count_i += 1
                    if count_i > count:
                        count = count_i
                        max_divisor = i

            if y // i <= y:
                if y // i >= x:
                    count_y_i = 0
                    for j in range(x, y + 1):
                        if j % (y // i) == 0:
                            count_y_i += 1
                    if count_y_i > count:
                        count = count_y_i
                        max_divisor = y // i
    return max_divisor
```

