def zigzag(n, k):
    """
    Given two positive integers n and k, find the entringer number e(n, k).
    The entringer number e(n, k) is defined as the number of ways to reach from 1 to n using steps of size k,
    where the steps can be either right (k) or up (1).
    For example:
    zigzag(2, 2) == 3
    zigzag(3, 2) == 4
    zigzag(4, 2) == 6
    """
    if k == 1:
        return 1
    dp = [[0] * (n + 1) for _ in range(n + 1)]
    for i in range(n + 1):
        for j in range(n + 1):
            if i == 0 and j == 0:
                dp[i][j] = 1
            else:
                if i > 0:
                    dp[i][j] += dp[i - 1][j]
                if j > 0:
                    dp[i][j] += dp[i][j - 1]
    return dp[n][n]
```

