    Finds the item with maximum occurrences in a given list.
    If multiple items have the same maximum occurrences, return the first one encountered.
    """
    if not nums:
        return None

    counts = {}
    for num in nums:
        counts[num] = counts.get(num, 0) + 1

    max_item = nums[0]
    max_count = counts[nums[0]]

    for num, count in counts.items():
        if count > max_count:
            max_count = count
            max_item = num

    return max_item
