def is_tree_balanced(root):
    """
    Checks if a binary tree is balanced or not.

    A binary tree is balanced if the height of the two subtrees of every node never differ by more than 1.

    Args:
        root: The root node of the binary tree.

    Returns:
        True if the binary tree is balanced, False otherwise.
    """

    def get_height(node):
        if not node:
            return 0
        return 1 + max(get_height(node.left), get_height(node.right))

    if not root:
        return True

    left_height = get_height(root.left)
    right_height = get_height(root.right)

    if abs(left_height - right_height) > 1:
        return False

    return is_tree_balanced(root.left) and is_tree_balanced(root.right)
```

