def permute_string(str):
    """
    Given a string, print all permutations of the string including duplicates.
    For example:
    permute_string("aab") == "aab", "aba", "baa"
    permute_string("abc") == "abc", "acb", "bac", "bca", "cab", "cba"
    """
    if len(str) == 0:
        return ""

    result = []

    def backtrack(combination, remaining):
        if not remaining:
            result.append("".join(combination))
            return

        for i in range(len(remaining)):
            backtrack(combination + [remaining[i]], remaining[:i] + remaining[i+1:])

    backtrack([], list(str))
    return ", ".join(result)
```

