    """
    Remove tuple elements that occur more than once and replace the duplicates with some custom value.
    For example:
    remove_replica((1, 2, 3, 2, 1, 4)) == (1, 2, 3, 4)
    remove_replica((1, 1, 1, 1, 1)) == (1,)
    """
    counts = {}
    result = []
    for element in test_tup:
        if element in counts:
            counts[element] += 1
        else:
            counts[element] = 1
    for element in test_tup:
        if counts[element] == 1:
            result.append(element)
    return tuple(result)
