def convert_list_dictionary(l1, l2, l3):
    """
    Given three lists, convert them into a nested dictionary.
    The first list will contain the keys of the dictionary.
    The second list will contain the values of the dictionary.
    The third list will contain the keys of the nested dictionaries.
    The fourth list will contain the values of the nested dictionaries.
    For example:
    convert_list_dictionary(['a', 'b', 'c'], [1, 2, 3], ['x', 'y'], [4, 5]) == {'a': {'x': 4, 'y': 5}, 'b': {'x': 4, 'y': 5}, 'c': {'x': 4, 'y': 5}}
    convert_list_dictionary(['a', 'b'], [1, 2], ['x'], [4, 5]) == {'a': {'x': 4}, 'b': {'x': 5}}
    convert_list_dictionary(['a'], [1], ['x'], [4]) == {'a': {'x': 4}}
    """
    result = {}
    for i in range(len(l1)):
        result[l1[i]] = {}
        for j in range(len(l2)):
            result[l1[i]][l2[j]] = l3[j]
    return result
