def max_sum_recursive(n):
    """
    Finds the maximum sum possible by using the given equation
    f(n) = max( (f(n/2) + f(n/3) + f(n/4) + f(n/5)), n).

    Args:
        n: The input integer.

    Returns:
        The maximum sum possible.
    """
    if n <= 0:
        return 0

    if n == 1:
        return 1

    values = []
    if n % 2 == 0:
        values.append(max_sum_recursive(n // 2))
    if n % 3 == 0:
        values.append(max_sum_recursive(n // 3))
    if n % 4 == 0:
        values.append(max_sum_recursive(n // 4))
    if n % 5 == 0:
        values.append(max_sum_recursive(n // 5))

    max_val = 0
    for val in values:
        max_val = max(max_val, val)

    return max(max_val, n)
