def breakSum(n):
    """
    Given a non-negative integer n, find the maximum sum we can make by dividing
    n into three parts and summing them up together.
    For example:
    breakSum(10) == 10
    breakSum(100) == 100
    breakSum(101) == 100
    """
    if n == 0:
        return 0
    if n == 1:
        return 1
    if n == 2:
        return 2
    if n == 3:
        return 3

    dp = {}

    def solve(remaining_sum):
        if remaining_sum == 0:
            return 0
        if remaining_sum < 0:
            return float('-inf')

        if remaining_sum in dp:
            return dp[remaining_sum]

        max_sum = float('-inf')
        for i in range(1, remaining_sum + 1):
            max_sum = max(max_sum, i + solve(remaining_sum - i))

        dp[remaining_sum] = max_sum
        return max_sum

    return solve(n)
```

