def find_peak(arr, n):
    """
    Given an array arr[] of n integers, find a peak element in it.
    A peak element is an element that is greater than its neighbors.
    """
    if n == 1:
        return arr[0]

    for i in range(1, n - 1):
        if arr[i] > arr[i - 1] and arr[i] > arr[i + 1]:
            return arr[i]

    if arr[0] > arr[1]:
        return arr[0]

    if arr[n - 1] > arr[n - 2]:
        return arr[n - 1]

    return -1
```

