def max_product(arr, n):
    """
    Given an array of integers, find the maximum product formed by multiplying numbers of an increasing subsequence of that array.
    For example:
    max_product([1, 2, 3, 4], 4) == 24
    max_product([1, 3, 2, 4], 4) == 12
    max_product([4, 3, 2, 1], 4) == 4
    """
    inc = [1] * n
    for i in range(1, n):
        for j in range(i):
            if arr[i] > arr[j]:
                inc[i] = max(inc[i], inc[j] * arr[i])
    return max(inc)
