    For example:
    max_product([1, 2, 3, 4], 4) == 24
    max_product([1, 3, 2, 4], 4) == 12
    max_product([4, 3, 2, 1], 4) == 12
    """
    inc = [1] * n
    for i in range(1, n):
        for j in range(i):
            if arr[i] > arr[j]:
                inc[i] = max(inc[i], inc[j] * arr[i])
    return max(inc)
```

