def same_order(l1, l2):
    """
    Check if the common elements between two given lists are in the same order or not.
    For example:
    same_order([1, 2, 3, 4, 5], [3, 1, 2, 5, 4]) == True
    same_order([1, 2, 3, 4, 5], [3, 1, 2, 6, 4]) == False
    """
    common = []
    for element in l1:
        if element in l2:
            common.append(element)
    if len(common) == 0:
        return True
    for i in range(len(common) - 1):
        if common[i] != common[i+1]:
            return False
    return True
```

